import { Container, Row, Col, Card, CardHeader, CardBody } from 'reactstrap';

const TablaContenido = () => {
    return (
        <Table>
            <thead>
                <tr>
                    <th>Id</th>
                    <th>Nombre</th>
                    <th>Apellido</th>
                    <th>Correo</th>
                    <th>Pass</th>
                </tr>
            </thead>
            <tbody>
            </tbody>
        </Table>
      )
}
export default TablaContenido;
